import React from "react";
import "./styles/navbar.css";

export default function Navbar() {
  return (
    <nav>
      <div className="logo">
        <h2>Tenzor</h2>
        {/* <img src="../images/" alt="" /> */}
      </div>
      <input type="text" />
      <ul>
        <li>Home</li>
        <li>Products</li>
        <li>Account</li>
        <li>
          Upload &nbsp;<i class="fa-solid fa-arrow-up-from-bracket fa-sm"></i>
        </li>
        <li>Contact us</li>
      </ul>
    </nav>
  );
}
